import React from 'react'
import {BrowserRouter,Route} from "react-router-dom";
import Login from "./components/login/Login"

const App=()=>{
  return(<>
    <div className="App">
    <BrowserRouter>
     <Route exact path="/Login" component={Login}/>
    </BrowserRouter>
    </div>
    </>
  );
}
export default App;
